   swip.getAllPlanets().then((el)=>{
       console.log(el);
   })

   return(
       <div   className="random-planet">
         <img className="planet-image"
             src = "https://starwars-visualguide.com/assets/img/planets/10.jpg" alt = 'pict show'/>
         <div className="flex-column"> 
               <h3>Name Planet</h3>
         <div className = "list-group">
             <ul className = "list-group-item flex-column">
                <li className=" list-group-item term    ">
                    <a>People</a>
                </li>
                <li className="list-group-item term    ">
                    <a>Planet</a>
                </li>
                <li className="list-group-item term    ">
                    <a>StarShip</a>
                </li>
             </ul>
        </div>
            </div>
       </div>
   );
};

export default RandomPlanet;
